		EXEC(@roomBackup);
		EXEC(@reservationBackup);
		EXEC(@roomSessionBackup);
		EXEC(@roomStudentBackup);
		EXEC(@occupantBackup);
	*/

	DECLARE	@housingYear			INT		=	YEAR(GETDATE())
	DECLARE	@housingYearExists		INT		=	(SELECT COUNT(*) FROM CUS_Housing_RoomSession	HRS	WHERE	HRS.HousingYear	=	@housingYear)

	--If room information for the current year already exists clear it out so a duplicate set of rooms is not accidentally created.
	--IMPORTANT: Once this code is ready for production, this should be removed so that live data is not removed unintentionally
	IF @housingYearExists > 0
		BEGIN
			--CUS_Housing_SessionOccupant must be cleared before CUS_Housing_RoomSession because of constraints on the RoomSessionID relationship
			DELETE
				SO
			FROM
				CUS_Housing_RoomSession	HRS	INNER JOIN	CUS_Housing_SessionOccupant	SO	ON	HRS.RoomSessionID	=	SO.RoomSessionID
			WHERE
				HRS.HousingYear	=	@housingYear;
			
			DELETE FROM
				CUS_Housing_RoomSession
			WHERE
				CUS_Housing_RoomSession.HousingYear	=	@housingYear;

			SET @housingYear = 0;
			PRINT	'Cleared CUS_Housing_RoomSession data for ' + CAST(@housingYear AS VARCHAR);
		END

	IF @housingYearExists = 0
		BEGIN
			SELECT
				NEWID(), R.RoomID, R.DefaultGender, R.DefaultGreek, @housingYear
			FROM
				CUS_Housing_Room	R

			PRINT	'Instantiated values in CUS_Housing_RoomSession for calendar year ' + CAST(@housingYear AS VARCHAR);
			/*
				--Run this code against the CX datasource and paste the results below
				SELECT
					"INSERT INTO CUS_Housing_SessionOccupant (StudentID, RoomSessionID) VALUES ( (SELECT FWK_User.ID FROM FWK_User WHERE CAST(FWK_User.HostID AS INT) = " || id ||
					"), (SELECT HRS.RoomSessionID FROM CUS_Housing_RoomSession HRS INNER JOIN CUS_Housing_Room HR ON HRS.RoomID = HR.RoomID INNER JOIN CUS_Housing_Building HB ON HR.BuildingID = HB.BuildingID WHERE HRS.HousingYear = " ||
					YEAR(TODAY) || " AND HR.RoomNumber = '" || TRIM(room) || "' AND HB.BuildingCode = '" || TRIM(bldg) || "'))" AS insertSQL
				FROM
					stu_serv_rec
				WHERE
					sess = 'RC'
				AND
					yr = YEAR(TODAY)
				AND
					bldg IN ('APT','DEN','JOH','MADR','OAK1','OAK2','OAK3','OAK4','OAK5','OAK6','SWE','TAR')
				ORDER BY
					bldg, room
			*/
		END
COMMIT